import { Link } from 'react-router-dom';

const Header = () => {
  return (
    <header>
      <h1>Contact Form Management System</h1>
      <nav>
        <Link to="/">Home</Link>
        <Link to="/messages">Messages</Link>
        <Link to="/users">Users</Link>
        <Link to="/reports">Reports</Link>
      </nav>
    </header>
  );
};

export default Header;
